import React from 'react';
import './Products.css';

const Products = () => {
  const products = [
    {
      id: 1,
      name: 'AIRBRUSH MATTE',
      description: 'Skin-perfecting bronzed filter for the face.',
      price: { original: 45.00, current: 40.00 },
      discount: '-11%',
      rating: 4,
      image: 'https://www.upload.ee/image/17769488/airbrush.png',
      featured: true
    },
    {
      id: 2,
      name: 'EYELINER PACK',
      description: 'A hyper-saturated, water-resistant, liquid eyeliner.',
      price: { current: 40.00, range: '40.00 - 80.00' },
      discount: '-11%',
      image: 'https://via.placeholder.com/300x300?text=Eyeliner+Pack',
      featured: true
    },
    {
      id: 3,
      name: 'FACE & BODY FOUNDATION',
      description: 'A foundation for the face and body.',
      price: { original: 45.00, current: 40.00 },
      discount: '-11%',
      image: 'https://via.placeholder.com/300x300?text=Foundation',
      featured: true
    },
    {
      id: 4,
      name: 'LACTIC ACID TREATMENT',
      description: 'An all-in-one AHA treatment.',
      price: { current: 37.00 },
      image: 'https://via.placeholder.com/300x300?text=Treatment',
      featured: true
    }
  ];

  return (
    <section className="products-section">
      <div className="products-header">
        <h2 className="products-title">TOP BRANDED</h2>
        <div className="products-dot">•</div>
        <h1>PRODUCTS</h1>
      </div>

      <div className="products-nav">
        <button className="active">FEATURED</button>
        <button>POPULAR</button>
        <button>CATEGORY</button>
        <button>BRAND</button>
      </div>

      <div className="products-grid">
        {products.map(product => (
          <div key={product.id} className="product-card">
            {product.discount && (
              <span className="discount-badge">{product.discount}</span>
            )}
            {product.featured && (
              <span className="featured-badge">FEATURED</span>
            )}
            <div className="product-image">
              <img src={product.image} alt={product.name} />
            </div>
            <div className="product-info">
              <h3>{product.name}</h3>
              <p>{product.description}</p>
              {product.rating && (
                <div className="product-rating">
                  {'★'.repeat(product.rating)}{'☆'.repeat(5-product.rating)}
                </div>
              )}
              <div className="product-price">
                {product.price.original && (
                  <span className="original-price">${product.price.original.toFixed(2)}</span>
                )}
                <span className="current-price">
                  ${product.price.range || product.price.current.toFixed(2)}
                </span>
              </div>
            </div>
          </div>
        ))}
      </div>

      <div className="products-navigation">
        <button className="nav-prev">‹</button>
        <button className="nav-next">›</button>
      </div>
    </section>
  );
};

export default Products;
